
var KalturaPaymentMethodProfileService={add:function(paymentMethod){var kparams=new Object();kparams.paymentMethod=paymentMethod;return new KalturaRequestBuilder("paymentmethodprofile","add",kparams);},deleteAction:function(paymentMethodId){var kparams=new Object();kparams.paymentMethodId=paymentMethodId;return new KalturaRequestBuilder("paymentmethodprofile","delete",kparams);},listAction:function(filter){var kparams=new Object();kparams.filter=filter;return new KalturaRequestBuilder("paymentmethodprofile","list",kparams);},update:function(paymentMethodId,paymentMethod){var kparams=new Object();kparams.paymentMethodId=paymentMethodId;kparams.paymentMethod=paymentMethod;return new KalturaRequestBuilder("paymentmethodprofile","update",kparams);}}